import { NgModule } from '@angular/core';
import { CommonModule } from '@angular/common';
import { SharedModule } from 'app/shared/shared.module';
import { AccordionModule } from 'primeng/accordion';
import { AutoCompleteModule } from 'primeng/autocomplete';
import { ButtonModule } from 'primeng/button';
import { CalendarModule } from 'primeng/calendar';
import { ConfirmPopupModule } from 'primeng/confirmpopup';
import { DialogModule } from 'primeng/dialog';
import { DropdownModule } from 'primeng/dropdown';
import { FormsModule, ReactiveFormsModule } from '@angular/forms';
import { InputTextModule } from 'primeng/inputtext';
import { InputTextareaModule } from 'primeng/inputtextarea';
import { MultiSelectModule } from 'primeng/multiselect';
import { RadioButtonModule } from 'primeng/radiobutton';
import { TableModule } from 'primeng/table';
import { TabViewModule } from 'primeng/tabview';
import { ToastModule } from 'primeng/toast';
import { ConfirmationService, MessageService } from 'primeng/api';
import { DialogService } from 'primeng/dynamicdialog';
import { NspConfirmationService } from 'app/shared/confirm/nsp-confirm.service';
import { IcCodeService } from 'app/ng-connect';

import { GenerateLetterComponent } from './generate-letter/generate-letter.component';
import { QueryGeneratedLettersComponent } from './query-generated-letters/query-generated-letters.component';
import { QueryGeneratedLettersByDetailComponent } from './query-generated-letters/by-detail/query-generated-letters-by-detail.component';
import { QueryGeneratedLettersBySummaryComponent } from './query-generated-letters/by-summary/query-generated-letters-by-summary.component';
import { LetterRoutingModule } from './route/letter-routing.module';

@NgModule({
  declarations: [
    GenerateLetterComponent,
    QueryGeneratedLettersComponent,
    QueryGeneratedLettersByDetailComponent,
    QueryGeneratedLettersBySummaryComponent
  ],
  imports: [
    CommonModule,
    SharedModule,
    AccordionModule,
    AutoCompleteModule,
    ButtonModule,
    CalendarModule,
    ConfirmPopupModule,
    DialogModule,
    DropdownModule,
    FormsModule,
    ReactiveFormsModule,
    InputTextModule,
    InputTextareaModule,
    MultiSelectModule,
    RadioButtonModule,
    TableModule,
    TabViewModule,
    ToastModule,
    LetterRoutingModule
  ],
  providers: [ConfirmationService, MessageService, DialogService, NspConfirmationService, IcCodeService]
})
export class LetterModule { }
